import { Paper, Typography, Box } from '@material-ui/core'
import PropTypes from 'prop-types';

const Card = ({ title, children, paper, ...props }) => {

    if (paper) {
        return (
            <Paper>
                <Box {...props}>
    
                    { title != undefined && 
                    <Typography variant="h3">
                        {title}
                    </Typography> }
    
                    {children}
    
                </Box>
            </Paper>
        )
    }

    return (
        <Box {...props}>

            { title != undefined && 
            <Box textAlign={{ xs: "center", md: "left" }}>
                <Typography variant="h3">
                    {title}
                </Typography>
            </Box> }

            {children}

        </Box>
    )
}

export default Card

Card.propTypes = {
    title: PropTypes.string,
    paper: PropTypes.bool,
    children: PropTypes.node,
}
